import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import React from 'react';

const activities = [
    { time: '9:00am', activity: 'Breakfast' },
    { time: '1:00pm', activity: 'Meet at park' },
    { time: '7:00pm', activity: 'Movie night' }
];

export default function DayContainer() {
    return (
        <Box border={1} color='black' width='80%'>
            <Box borderBottom={1} borderColor='lightgrey'>
                <Typography >_DATE_</Typography>
            </Box>
            <Box>
                {activities.map(each => {
                    return (
                        <Box py={.5} px={1.5} key={activities.indexOf(each)} display='flex' flexDirection='row'>
                            <Typography align='left'>{each.time}</Typography>
                            <Typography align='right'>{each.activity}</Typography>
                        </Box>
                    )
                })}
            </Box>
        </Box>
    )
}
